int casadi_f11_init_mem(int mem) {
  OSQPData data;
  OSQPSettings settings;
  casadi_int A_colind[1215], A_row[5778], H_colind[1215], H_row[32], i;
  casadi_real dummy[5778];
  csc A, H;
  casadi_clear(dummy, 5778);
  for (i=0;i<5778;++i) A_row[i] = casadi_s402[i];
  for (i=0;i<1215;++i) A_colind[i] = casadi_s403[i];
  for (i=0;i<32;++i) H_row[i] = casadi_s404[i];
  for (i=0;i<1215;++i) H_colind[i] = casadi_s405[i];
  A.m = 3343;
  A.n = 1214;
  A.nz = 5778;
  A.nzmax = 5778;
  A.x = dummy;
  A.i = A_row;
  A.p = A_colind;
  H.m = 1214;
  H.n = 1214;
  H.nz = 32;
  H.nzmax = 32;
  H.x = dummy;
  H.i = H_row;
  H.p = H_colind;
  data.n = 1214;
  data.m = 3343;
  data.P = &H;
  data.q = dummy;
  data.A = &A;
  data.l = dummy;
  data.u = dummy;
  osqp_set_default_settings(&settings);
  settings.rho = 0.1;
  settings.sigma = 1e-06;
  settings.scaling = 10;
  settings.adaptive_rho = 1;
  settings.adaptive_rho_interval = 0;
  settings.adaptive_rho_tolerance = 5;
  settings.max_iter = 4000;
  settings.eps_abs = 0.001;
  settings.eps_rel = 0.001;
  settings.eps_prim_inf = 0.0001;
  settings.eps_dual_inf = 0.0001;
  settings.alpha = 1.6;
  settings.delta = 1e-06;
  settings.polish = 0;
  settings.polish_refine_iter = 3;
  settings.verbose = 1;
  settings.scaled_termination = 0;
  settings.check_termination = 25;
  settings.warm_start = 0;
  casadi_f11_mem[mem] = osqp_setup(&data, &settings);
  return 0;
}

void casadi_f11_free_mem(int mem) {
  osqp_cleanup(casadi_f11_mem[mem]);
}

int casadi_f11_checkout(void) {
  int mid;
  if (casadi_f11_unused_stack_counter>=0) {
    return casadi_f11_unused_stack[casadi_f11_unused_stack_counter--];
  } else {
    if (casadi_f11_mem_counter==CASADI_MAX_NUM_THREADS) return -1;
    mid = casadi_f11_alloc_mem();
    if (mid<0) return -1;
    if(casadi_f11_init_mem(mid)) return -1;
    return mid;
  }
  return casadi_f11_unused_stack[casadi_f11_unused_stack_counter--];
}

void casadi_f11_release(int mem) {
  casadi_f11_unused_stack[++casadi_f11_unused_stack_counter] = mem;
}

